        "description": "El programa propone este viernes un divertido viaje por los últimos 40 años de historia de la música española, con la visita de los cantantes Aitana y Francisco.\n\nJunto a muchas curiosidades, en el programa descubriremos que ambos comparten, además de su talento para cantar, unas raíces comunes jiennenses.\n\nAitana aprovechará la entrevista de Juan y Medio  para dar algunos detalles sobre su próximo debut discográfico y hablar sobre cómo está llevando su repentina fama, gracias a canciones como \"Teléfono\" o \"Lo malo\".  La joven solista nos brindará un emotivo momento, al unirse por sorpresa a la actuación de una pequeña admiradora.\n\nLos conocidos niños de la escalera Roberto y Paquito se meterán en la piel de dos policías con la mano suelta para las multas y someterán a Aitana al interrogatorio más alocado que se recuerda en \"Menuda Noche\".\n\nPor su lado, Manolo Sarria intentará librarse de un nuevo castigo demostrando su pericia para el baile latino. A pesar de sus esfuerzos y de contar con la ayuda de Francisco, volverá a tener que rendir cuentas ante el presentador al final del programa. ¿Qué tendrá en mente Juan y Medio esta vez?\n\nFrancisco recordará algunas de sus mejores canciones y, en compañía de la joven Claudia, volverá a interpretar la canción con la que triunfó en el Festival de la OTI, \"A dónde voy sin ti\".\n\nEn \"Menudo Fandango\", la invitada será Marisol Bizcocho, ex concursante de \"Yo soy del Sur\". Ella decidirá cuál es la mejor letra de la noche, antes de dedicarle unas sevillanas a su pueblo natal, \"Coria\".\n\nJuan y Medio tiene cada noche un invitado para someterse a las divertidas preguntas de los colaboradores infantiles.",
